import React from 'react';
import './SprayLandingPage.css';
import Navbar from './Navbar';
import roller1 from './roller1'; // Assuming roller1 is a component or an image
const SprayLandingPage = () => {
  return (
    <div className="spray-container">
      <div className="rectangle31"></div>
      <div className="frame243">
        <img src="/assets/image 25.png" alt="Spray painting drone background" className="image25" />
      </div>
      <img src="/assets/Screenshot 2024-07-21 at 8.53.11 PM 1.png" alt="Company footer" className="screenshot2024" />
      <div className="vector30"></div>
      <div className="vector30-2"></div>
      <div className="vector-gray"></div>
      <div className="vector-gray-2"></div>
      <div className="vector-gray-3"></div>
      <div className="vector-gray-4"></div>
      <div className="vector-gray-5"></div>
      <div className="vector-gray-6"></div>
      <Navbar />
      <roller1 />
    </div>
  );
};

export default SprayLandingPage;
